import React, { useState } from 'react';
import './profiel-aanmaken.css';

const ProfielAanmaken = () => {
  const [formData, setFormData] = useState({
    nickname: '',
    oneliner: '',
    relationshipPreference: '',
    lookingFor: '',
    profilePhoto: null,
    gender: '',
    interestedIn: '',
    birthDate: '',
    optionalFields: {
      educationLevel: '',
      languages: [],
      hobbies: [],
      sportsFrequency: '',
      musicStyles: '',
    },
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleOptionalChange = (field, value) => {
    setFormData({
      ...formData,
      optionalFields: { ...formData.optionalFields, [field]: value },
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Submitted data:', formData);
    // Redirect logic here
  };

  return (
    <div className="profile-container">
      <h2>Profiel Aanmaken</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="nickname">Nickname:</label>
          <input
            type="text"
            id="nickname"
            name="nickname"
            value={formData.nickname}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="oneliner">Oneliner:</label>
          <textarea
            id="oneliner"
            name="oneliner"
            value={formData.oneliner}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="relationshipPreference">Relatiewaarde:</label>
          <select
            id="relationshipPreference"
            name="relationshipPreference"
            value={formData.relationshipPreference}
            onChange={handleInputChange}
            required
          >
            <option value="">Selecteer...</option>
            <option value="serieus">Serieuze Relatie</option>
            <option value="vriendschap">Vriendschap</option>
            <option value="open">Open Relatie</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="languages">Talen die je spreekt:</label>
          <select
            id="languages"
            name="languages"
            value={formData.optionalFields.languages}
            onChange={(e) =>
              handleOptionalChange('languages', Array.from(e.target.selectedOptions, (option) => option.value))
            }
            multiple
          >
            <option value="nederlands">Nederlands</option>
            <option value="engels">Engels</option>
            <option value="spaans">Spaans</option>
            <option value="frans">Frans</option>
            <option value="duits">Duits</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="sportsFrequency">Sportiviteit:</label>
          <select
            id="sportsFrequency"
            name="sportsFrequency"
            value={formData.optionalFields.sportsFrequency}
            onChange={(e) => handleOptionalChange('sportsFrequency', e.target.value)}
          >
            <option value="">Selecteer...</option>
            <option value="nooit">Nooit</option>
            <option value="soms">Soms</option>
            <option value="regelmatig">Regelmatig</option>
            <option value="vaak">Vaak</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="hobbies">Hobbies:</label>
          <textarea
            id="hobbies"
            name="hobbies"
            value={formData.optionalFields.hobbies}
            onChange={(e) => handleOptionalChange('hobbies', e.target.value.split(','))}
            placeholder="Bijv: Lezen, Schilderen"
          />
        </div>

        <div className="form-group">
          <label htmlFor="musicStyles">Muziekstijlen:</label>
          <textarea
            id="musicStyles"
            name="musicStyles"
            value={formData.optionalFields.musicStyles}
            onChange={(e) => handleOptionalChange('musicStyles', e.target.value.split(','))}
            placeholder="Bijv: Pop, Jazz"
          />
        </div>

        <button type="submit">Profiel Aanmaken</button>
      </form>
    </div>
  );
};

export default ProfielAanmaken;
